description.en:
The objective of this Tracer Study (Baseline 2013) is to provide information about capacities and the quality of the work of the contractors that were awarded R4D contracts for 2013/2014 R4D road works. Through later end-line studies1 the effectiveness of R4D’s training and capacity building activities will be assessed in terms of increased contractors’ capacities in planning and delivering capital investments in rural road works. Specific performance indicators – as defined in the R4D Results Framework – that the Tracer Study aims to assess/trace, include:
1. Increase in business turn-over;
2. Increase in equipment and staffing capacities;
3. Indicators related to the quality of work of completed contracts.
